import { useContext } from "react"
import "./style/Appointment.css"
import { DoctorContext } from "../context/DoctorContext"

const AppointmentComponent = ({doctor}) => {

    return (
        <div className="appointment_form">
            {
                doctor.gender=="Male" ?
                <img src={require("../assets/doctorMale.png")} className="appointment_doctor" />
                : <img src={require("../assets/doctorFemale.png")} className="appointment_doctor" />
            }
        </div>
    )
}

const Appointment = () => {

    const { doctors, handleGetDoctors } = useContext(DoctorContext)

    return (
        <div className="appointment_container">
            {
                doctors.map((doctor, index) => {
                    return <AppointmentComponent key={index} doctor={doctor} />
                })
            }
        </div>
    )
}

export default Appointment;
